import "./Footer.scss";



const Footer = () => {
	return <footer className="footer">
		<div className="footer-content">
			<div className="col">
				<div className="title"></div>
			</div>
			<div className="col">col2</div>
			<div className="col">col3</div>
			<div className="col">col4</div>
			</div>
		</footer>;
};

export default Footer;
